import logo from './paypal-logo.jpeg';
import './App.css';

function App() {
  return (
    <div style={{display: 'flex', justifyContent: 'center'}}>
      <div style={{
        margin: '120px 460px 0',
        border: '1px solid #eaeced',
        borderRadius: '12px',
        overflow: 'hidden',
        padding: '30px 10% 50px'}}>
        <header style={{margin: '0 auto 13.116%'}}>
          <img src={logo} style={{width: '34px', height: '40px'}}></img>
        </header>
      </div>
    </div>
  );
}

export default App;
